                height: '86px',
                fontSize: '18px',
                // lineHeight: '30px',
                fontWeight: '400',
                lineHeight: '28px',
                marginTop: '40px',
              }}
            >
              `You want to know how flex works? Weâ€™ve got you. Take a quick tour
              around Flex and see how it works. Sign up to get started!`
            </p>
          }
          image={handsonlaptop}
        />
        <button className="button">WATCH VIDEO </button>
      </div>
      <Footer />
    </div>
  );
}
